require_relative "valid_string"
require "test/unit"

class TestValidString < Test::Unit::TestCase
    def test_simple
        v = ValidString.new
        assert_equal('YES', v.validString('abc'))
        assert_equal('YES', v.validString('abcc'))
        assert_equal('NO', v.validString('aabbcd'))
        assert_equal('NO', v.validString('aabbccddeefghi'))
        assert_equal('YES', v.validString('abcdefghhgfedecba'))
        assert_equal('NO', v.validString('aaaabbcc'))
        assert_equal('NO', v.validString('aaaaabc'))
        assert_equal('YES', v.validString(''))
    end
    def test_large
        v = ValidString.new
        s = ''
        assert_equal('YES', v.validString(s))
    end
end
